import { gql } from '@apollo/client';
import { SITE_NAV_VARIANT } from './constants';

export const GET_BRAND_NAV = gql`
	query GetNav {		
			navigationCfModelList(filter: {_variation: {_expressions: [{value: "${SITE_NAV_VARIANT}", _ignoreCase: true}]}}) 
			{
			  items {
				generatedNavigationList
			  }
			}
	}
	`;
